export interface JDSFABProps {
    /** It can be used to show or hide FAB. */
    show?: boolean;
    /** When false, shows only icon. */
    extend?: boolean;
    /** It can be used to control the entry animation of FAB */
    disableAnimation?: boolean;
    /** It displays the title of FAB. */
    title?: string;
    /** It displays icon of FAB. */
    icon?: string | JSX.Element;
    onClick?: (ev: React.MouseEvent<HTMLButtonElement>) => void;
    onHover?: () => void;
    onHoverEnd?: () => void;
    ariaLabel?: string;
    ariaDescribedby?: string;
    custom?: string;
}
